import React,{useState} from "react";






const CodeEditor = () => {
  const [code, setCode] = useState("");
  return (
    <div>
      <input
        value={setCode}
        className="border rounded-2xl border-gray-400  mt-4 mx-6 w-11/12 h-[35rem] "
        type="text"
        onChange={(e) => setCode(e.target.value)}
      >{code}</input>
    </div>
  );
};

export default CodeEditor;
